import React from "react";

function Card(props) { 
    return (
        <div>
        <div className="card">
          <div className="top">
            <h2 className = "name">{props.name}</h2>
            <img
              className="circle-img"
              src="{props.img}"
              alt="{props.alt}"
            />
          </div>
          <div className="bottom">
            <p>{props.tele}</p>
            <p className="info">{props.email}</p>
          </div>
        </div>
      </div>
    );
};

